import React from 'react';
import { Link } from "react-router-dom";

const List = ({todoCategory}) => {
    return (  
      <div> 
        <React.Fragment>
           {
              todoCategory.map(item => (
            <ul className="list-group" key={item.id}>
              <li className="list-group-item">
                {item.categoryTitle}
              </li>   
              <li>
              <Link to={`/edit/${item.id}`}>
              <button >
                  edit
                </button>
              
              </Link>
              </li>
            </ul>
            ))
          }
         
        </React.Fragment>
      </div>
    );
} 

export default List;
